const AllRequests = (props) => {
    
  return (
    <div>
      {props.flag ? (
        <div>
          {props.productRequests.map((val) => {
            <div>
              <div>{val.name}</div>
              <div>{val.quantity}</div>
              <button>verification</button>
            </div>;
          })}
        </div>
      ) : (
        <div>
          {props.adminRequests.map((val) => {
            <div>
              <div>{val.name}</div>
              <div>{val.email}</div>
              <button>Confirm</button>
              <button>Reject</button>
            </div>
          })}
        </div>
      )}
    </div>
  );
};

export default AllRequests;
